import React from 'react';
import SideBar from "../SideBar/SideBar";
import Header from "../Header/Header";
import Music from "./Music";


const MusicPage = () => {
    return (
        <div>
            <Header/>
            < div className='content-wrapper'>
                <div>
                    < SideBar/>
                </div>
                <div>
                    <Music/>
                </div>
            </div>
        </div>
    );
}

export default MusicPage
